let submitExport=document.getElementById("submit_export");submitExport&&submitExport.addEventListener("click",function(e){e.preventDefault();let t=document.querySelectorAll(".mimetype-radio:checked"),o=[],n=document.querySelectorAll(".lang-radio:checked"),c=[],l=document.querySelectorAll(".field-checkbox:checked"),i=[];t.length>0&&t.forEach(function(e){o.push(e.value)}),n.length>0&&n.forEach(function(e){c.push(e.value)}),l.length>0&&l.forEach(function(e){i.push(e.value)}),fetch("/wp-json/woody/attachments/exportdata",{method:"POST",headers:{Accept:"application/json","Content-Type":"application/json","X-WP-Nonce":wpApiSettings.nonce},body:JSON.stringify({mimetype:o,lang:c,fields:i})}).then(e=>e.json()).then(e=>{console.log(e)}).catch(e=>{console.error("Attachments delete fetch: "+e)})});